def fdtd_2d_part2(nx: int, ny: int, ex: List[List[int]], hz: List[List[int]]) -> List[List[int]]:
    return matrix_elemwise_sub(
        matrix_col_slice(ex, 1, ny),
        matrix_scalar_mul(
            5,
            matrix_elemwise_sub(
                matrix_col_slice(hz, 1, ny),
                matrix_col_slice(hz, 0, ny - 1)
            )
        )
    )
